```
// generate random key pair. You can also get a key pair from a private key using `getKeyPair(pk: BigNumberish)`
const keyPair = ec.genKeyPair();

const deployWalletTx = await defaultProvider.deployContract(
COMPILED_WALLET_CONTRACT_JSON,  // compiled JSON (should be imported as a string, as native JS parsing destroys its data)
                                // get it from ie checking out https://github.com/OpenZeppelin/cairo-contracts/blob/main/contracts/Account.cairo and building it. You need the compiled contract json
[ec.getStarkKey(keyPair)],      // arguments to the contract constructor, containing the stark public key here
0,                              // seed, defaults to a random value, so you never get a transaction hash collision
);

// wait for wallet to be deployed
await defaultProvider.waitForTx(deployWalletTx.transaction_hash);

// initialize the signer with the wallet address and key pair
const signer = new Signer(defaultProvider, deployWalletTx.address, keyPair);

// done, you can now:
// read (callContract, can also be done the same with just the default provider)
// and write (sendTransaction, will be passed through the account contract) with the signer now
``` 

