Hey guys, some of your type are outdated I think. Like the `GetBlockResponse`
```
export declare type GetBlockResponse = {
    block_number: number;
    state_root: string;
    block_hash: string;
    transactions: {
        [txHash: string]: Transaction;
    };
    timestamp: number;
    transaction_receipts: {
        [txHash: string]: {
            block_hash: string;
            transaction_hash: string;
            l2_to_l1_messages: {
                to_address: string;
                payload: string[];
                from_address: string;
            }[];
            block_number: BlockNumber;
            status: Status;
            transaction_index: number;
        };
    };
    previous_block_hash: string;
    status: Status;
};
```
I had to update it to this
```
export declare type GetBlockResponse = {
  block_number: number;
  state_root: string;
  block_hash: string;
  transactions: Transaction[];
  timestamp: number;
  transaction_receipts: TransactionReceipt[];
  previous_block_hash: string;
  status: Status;
};
```
and add the `events: Event[]` to the transaction receipt

Also had to add `EventAbi` to `GetCodeResponse`
```
export declare type GetCodeResponse = {
  bytecode: string[];
  abi: Abi;
};

export declare type EventAbi = {
  data: { name: string, type: string }[],
  keys: string[],
  name: string,
  type: 'event'
};

export declare type Abi = Array<FunctionAbi | StructAbi | EventAbi>;
```

