```@view
func get_pixels{syscall_ptr : felt*, pedersen_ptr : HashBuiltin*, range_check_ptr}() -> (pixels_len : felt, pixels : felt*):    
    let pixels : felt* = alloc()
    let (pix) = calc(x=0, y=0)
    assert pixels[0] = pix
    let (pix) = calc(x=1, y=0)
    assert pixels[1] = pix
    ...
    let (pix) = calc(x=9, y=9)
    assert pixels[99] = pix

    return (pixels_len=100, pixels=pixels)
end```

```
func calc(x : felt, y) -> (val : felt):
    let val = ((x * x) + (y * y)) * 2
    return (val)
end
```

