1. I highly recommend you to use `get-starknet` directly so you'll be up-to-date with the community's, cross-wallet's, latest updated lib. btw, `@argent/get-starknet` uses it internally.
2. `connect` matches the dapp with a wallet object as per user's choice. it could be the latest chosen wallet, a pre-authorized wallet, etc. `get-starknet` handles that internally for you, no need to write custom logic/flows here.
3. the recommended flow is -
a. attempt to silently connect with a wallet
b. if failed, show the "connect a wallet" button/UI to your users/

