function str_to_felt(text) {
  if (text.length > 31) {
    throw new Error("Text length too long to convert to felt.");
  }

  let hexString = "";
  for (let i = 0; i < text.length; i++) {
    const hex = text.charCodeAt(i).toString(16);
    hexString += hex.length === 1 ? "0" + hex : hex;
  }
  return BigInt("0x" + hexString);
}

export default function str_to_felt_array(text) {
  const feltArray = [];
  for (let i = 0; i < text.length; i += 31) {
    feltArray.push(str_to_felt(text.slice(i, i + 31)));
  }
  return feltArray;
}

