Take care of 2 things : 
- `amount` and other `supply` keys are generally waiting an uint256 type (read abi file to check) : in this case use : 
```typescript
const toTransferTk: uint256.Uint256 = uint256.bnToUint256(10);
// in compileCalldata :
amount: { type: 'struct', low: toTransferTk.low, high: toTransferTk.high }
});
```
- For array, you MUST not use `xxx_len` keys ; it will be performed automatically by Starknet.js v4.

